17.value:
pure(
  ({
    value = false,
    onChange,
    label,
    error,
    description,
    disabled,
    required,
    fullWidth,
    margin,
    onBlur,
    onFocus,
    ...props
  }: CheckboxProps) => (
    <FormField
      disabled={disabled}
      required={required}
      description={description}
      error={error}
      fullWidth={fullWidth}
      margin={margin}
      onBlur={onBlur}
      onFocus={onFocus}
    >
      {wrapWithLabel(
        label,
        <MUICheckbox
          {...props}
          checked={value}
          onChange={onChange && ((_, checked) => onChange(checked))}
          disabled={disabled}
        />,
      )}
    </FormField>
  ),
)

20.value:
pure(
  ({
    value = '',
    onChange,
    label,
    error,
    description,
    disabled,
    required,
    id,
    startAdornment,
    endAdornment,
    fullWidth,
    margin,
    onBlur,
    onFocus,
    choices,
    ...props
  }: SelectProps) => (
    <FormField
      disabled={disabled}
      required={required}
      description={description}
      error={error}
      fullWidth={fullWidth}
      margin={margin}
      onBlur={onBlur}
      onFocus={onFocus}
    >
      {label && (
        <InputLabel htmlFor={id} error={false} required={false}>
          {label}
        </InputLabel>
      )}
      <MUISelect
        {...props}
        value={value}
        onChange={onChange && (event => onChange(event.target.value))}
        input={
          <Input
            id={id}
            disabled={disabled}
            startAdornment={
              startAdornment && (
                <InputAdornment position="start">
                  {startAdornment}
                </InputAdornment>
              )
            }
            endAdornment={
              endAdornment && (
                <InputAdornment position="end">{endAdornment}</InputAdornment>
              )
            }
          />
        }
      >
        {choices.map((choice, i) => (
          <MenuItem key={i} value={choice.value}>
            {choice.label}
          </MenuItem>
        ))}
      </MUISelect>
    </FormField>
  ),
)

